import styled from "styled-components";

export const Image = styled.img`
    width: 10rem;
    margin: 1rem;
`

export const RequestButton = styled.button`
    text-decoration: none;
    font-family: 'Montserrat', sans-serif;
    background-color: #0E535E;
    color: #D9CBB0;
    font-size: 15px;
    padding: 1rem 1.5rem;
    margin: 0 1.5rem;
    margin-top: 1.5rem;
    width: 50%;
    &:hover {
        background: #4F8189;
      }
`

export const VolunteerImage = styled.img`
      width: 100%;
      max-height: 600px;
`

export const SubmitButton = styled.button`
    text-decoration: none;
    font-family: 'Montserrat', sans-serif;
    background-color: #5F191B;
    color: #D9CBB0;
    font-size: 15px;
    padding: 1rem 1.5rem;
    margin: 0 1.5rem;
    &:hover {
        background: #8A5759;
      }
`
